INSERT INTO `posts` VALUES ('13', '我本楚狂人，凤歌笑孔丘', '我们一直在坚持着，不是为了改变这个世界，而是希望不被这个世界所改变。', '1', '凤歌', '老张得了一个闺女。老张说，挺好，就是大了别长得像我，那可嫁不出去了。因此，女儿名美丽，自然姓张。 老张的大学同学都说，叫个美丽，没什么不好，就是俗了点。老张你也是读过书的人，怎么不能想个雅点儿的呢？ \r\n老张说，俗有什么不好？实惠。这年头你还想怎么着？结结实实的吧。 \r\n老张的同学说，结实？那叫矿石好了，叫火成岩，水成岩也成。咱们这行就是学了个结实。\r\n老张在大学读的地质。 \r\n老张疼闺女。 \r\n老张抽烟。', '1', '14748744427770.jpg', '2016-09-26 16:43:53', '0000-00-00 00:00:00', '北极熊猫');
INSERT INTO `posts` VALUES ('14', '陌上花开，可缓缓归矣。', '那时候刚好下着雨，柏油路面湿冷冷的，还闪烁着青、黄、红颜色的灯火。我们就在骑楼下躲雨，看绿色的邮筒孤独地站在街的对面。', '1', '陌上花开', '秋天了，美丽大了点儿，手会指东西，指妈妈，指爸爸，还会抓耳朵，抓妈妈的头发，抓爸爸的鼻子。 \r\n有一天，老张的老婆抱着美丽，老张在旁边挤眉弄眼，逗得美丽嘎嘎乐，两只小手儿奓着。老张的老婆把美丽凑到老张的脸前，美丽的手就伸进爸爸的嘴里。 \r\n说时迟，那时快，老张抬手就是一掌，把母女两个打了个趔趄。老张在地质队，天天握探锤打石头，手上总有百来斤的力气。老张的老婆没有提防，就跌到了。到底是母亲，着地的关头，一扭身仰着将美丽抓在胸口。 \r\n美丽大哭。老张的老婆脑后淌出血来，从来没有骂过人的人，骂人了，老张的老婆骂老张。\r\n老张呆了，浑身哆嗦着，喘不出气来，汗从头上淌进领子里。 \r\n老张进了医院，两天一夜，才说出话来—— ', '1', '14748750504781.jpg', '2016-09-26 16:43:53', '0000-00-00 00:00:00', '北极熊猫');
INSERT INTO `posts` VALUES ('15', '一想到你，我这张丑脸上就泛起微笑', '那一天我二十一岁，在我一生的黄金时代。我有好多奢望。我想爱，想吃，还想在一瞬间变成天上半明半暗的云。', '1', '奢望', '六零年，闹饥荒，饿死人，全国都闹，除了云南。那年，我毕业实习，进山找矿。 \r\n后来，我迷路了。有指南针，没用。我饿，我饿呀。慌，心慌，一慌就急。本来还会想，这下完了。一直就吃不够，体力差，肝里的糖说耗完就耗完。后来就出汗，后来汗也不出了。什么也不敢想，用脑子最消耗热量了。躺着。胃里冒酸水儿，杀得牙软。 \r\n后来，从肚子开始发热，脚心，脖子，指头尖儿，越来越烫。安徒生不是写过个卖火柴的小女孩儿吗？这个丹麦的老东西，他写得对。人饿死前，就是发热，热过了，就是死。 \r\n我没死。死了怎么还能跟你结婚？怎么还能有美丽？              ', '1', '14748752131457.jpg', '2016-09-26 16:43:53', '0000-00-00 00:00:00', '北极熊猫');
INSERT INTO `posts` VALUES ('16', '秋天', '抓耳朵', '1', '故事', '秋天了，美丽大了点儿，手会指东西，指妈妈，指爸爸，还会抓耳朵，抓妈妈的头发，抓爸爸的鼻子。 \r\n有一天，老张的老婆抱着美丽，老张在旁边挤眉弄眼，逗得美丽嘎嘎乐，两只小手儿奓着。老张的老婆把美丽凑到老张的脸前，美丽的手就伸进爸爸的嘴里。 \r\n说时迟，那时快，老张抬手就是一掌，把母女两个打了个趔趄。老张在地质队，天天握探锤打石头，手上总有百来斤的力气。老张的老婆没有提防，就跌到了。到底是母亲，着地的关头，一扭身仰着将美丽抓在胸口。 \r\n美丽大哭。老张的老婆脑后淌出血来，从来没有骂过人的人，骂人了，老张的老婆骂老张。\r\n老张呆了，浑身哆嗦着，喘不出气来，汗从头上淌进领子里。 \r\n老张进了医院，两天一夜，才说出话来——          ', '1', '14748815168387.jpg', '2016-09-26 17:18:36', '2016-09-26 17:18:36', '北极熊猫');
INSERT INTO `posts` VALUES ('18', '红衣佳人', '朝与同歌暮同酒', '2', '佳人', '红衣佳人白衣友，朝与同歌暮同酒，世人谓我恋长安，其实只恋长安某。 ——殊同 \r\n水银泻地的时候，忧愁穿过墙壁，又和着嘶哑的音乐，使我羞惭、灰心。整个夏季，仿佛一场，没有主题的游戏。 ——赵野 \r\n我感到自己仿佛变得蔚蓝，变得无边无际，眼睛和指尖上，栖息着无数的星辰。 ——马林·索雷斯库 \r\n手中的书页犹如薄薄的剃刀片白亮亮闪着寒光。在凌晨四时寂寞的时刻里，我可以听到孤独之根正一点点伸长的声音。 ——村上春树 \r\n你的明眸是映现我灵魂颤动的湖，我那成群结队的梦想，为寻求解脱，而纷纷投入你这秋波深处。 ——波德莱尔 \r\n当我们只剩下虚无，唯有沉默的太阳够好，是你的静寂，是无声的声音。 ——佩索阿', '0', '14748941718351.jpg', '2016-09-26 20:49:31', '2016-09-26 20:49:31', '北极熊猫');
